        Bar, 
        XAxis, 
        YAxis, 
        Tooltip, 
        CartesianGrid, 
        Legend, 
        ResponsiveContainer, 
    } from 'recharts';

export default function OrderBookChart () {

    const data = [
        { name: 'Category 1', value: 10 },
        { name: 'Category 2', value: 15 },
        { name: 'Category 3', value: 7 },
    ];

    const fakeData = [
        {asking_price: 100, shares: 50},
