    //         {/* <Tooltip /> */}
    //         {/* <Legend /> */}
    //         <Bar dataKey="shares" fill="#8884d8" />
    //     </BarChart>
    // );


    return (
            <BarChart 
                width={100} 
                height={100} 
                data={fakeData} 
                // margin={{ top: 20, right: 30, left: 20, bottom: 5 }}
            >
                <XAxis dataKey="asking_price" />
                <YAxis />
                <Bar dataKey="shares" fill="#8884d8" />
            </BarChart>
    )
}
